	@Inject
	public VersionDSLGrammarAccess(GrammarProvider grammarProvider,
		TranslationDslGrammarAccess gaTranslationDsl) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaTranslationDsl = gaTranslationDsl;
		this.pVersion = new VersionElements();
		this.pField = new FieldElements();
		this.pEntityRef = new EntityRefElements();
		this.pVersionRef = new VersionRefElements();
		this.pDefault = new DefaultElements();
		this.pRoutine = new RoutineElements();
		this.pAtRoutine = new AtRoutineElements();
		this.pValueOrAtRoutine = new ValueOrAtRoutineElements();
		this.pJBCRoutine = new JBCRoutineElements();
		this.pJavaRoutine = new JavaRoutineElements();
		this.pDealSlip = new DealSlipElements();
		this.unknownRuleYesNo = new YesNoElements();
		this.unknownRulePopupBehaviour = new PopupBehaviourElements();
		this.unknownRuleCaseConvention = new CaseConventionElements();
		this.unknownRuleDisplayType = new DisplayTypeElements();
		this.unknownRuleDealSlipFormatFunction = new DealSlipFormatFunctionElements();
		this.unknownRuleDealSlipTrigger = new DealSlipTriggerElements();
		this.unknownRuleBusinessDayControl = new BusinessDayControlElements();
		this.unknownRuleFunction = new FunctionElements();
		this.unknownRuleInputBehaviour = new InputBehaviourElements();
		this.unknownRuleExpansion = new ExpansionElements();
		this.unknownRuleAssociatedVersionsPresentationPattern = new AssociatedVersionsPresentationPatternElements();
		this.unknownRuleFieldsLayoutPattern = new FieldsLayoutPatternElements();
		this.pNID = new NIDElements();
		this.pINTEGER_OBJECT = new INTEGER_OBJECTElements();
	}

	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("com.odcgroup.t24.version.VersionDSL".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}


	public Grammar getGrammar() {
		return grammar;
	}


	public TranslationDslGrammarAccess getTranslationDslGrammarAccess() {
		return gaTranslationDsl;
	}


